import { useState } from "react";

const App = () => {
    const [counterValue, setCounter] = useState(0);
    const helper = (counter) => {
        setCounter(counter + 1);
    };
    return (
        <div
            onClick={(counterValue) => {
                helper(counterValue);
            }}
        >
            {counterValue}
        </div>
    );
};

export default App;
